y: Arial, sans-serif; font-size: 24px; border-bottom: 2px solid #2E86C1; padding-bottom: 5px; margin-top: 30px;\">Terms &amp; Conditions</h2>  \r\n\r\n<h3 style=\"color: #2E86C1; font-family: Arial, sans-serif; font-size: 20px; margin-top: 15px;\">Account</h3>  \r\n<p style=\"font-family: Arial, sans-serif; font-size: 16px; color: #333;\">  \r\n- Keep your account and password secure.<br>  \r\n- You are responsible for what you upload.  \r\n</p>  \r\n\r\n<h3 style=\"color: #2E86C1; font-family: Arial, sans-serif; font-size: 20px; margin-top: 15px;\">Content</h3>  \r\n<p style=\"font-family: Arial, sans-serif; font-size: 16px; color: #333;\">  \r\n- Do not upload illegal or offensive content.<br>  \r\n- We may remove any content at any time.  \r\n</p>  \r\n\r\n<h3 style=\"color: #2E86C1; font-family: Arial, sans-serif; font-size: 20px; margin-top: 15px;\">Responsibility</h3>  \r\n<p style=\"font-family: Arial, sans-serif; font-size: 16px; color: #333;\">  \r\n- We do not guarantee the accuracy of website information. Use at your own risk.  \r\n</p>  \r\n\r\n<h2 style=\"color: #2E86C1; font-family: Arial, sans-serif; font-size: 24px; border-bottom: 2px solid #2E86C1; padding-bottom: 5px; margin-top: 30px;\">Contact Us</h2>  \r\n<p style=\"font-family: Arial, sans-serif; font-size: 16px; color: #333;\">  \r\nOur Facebook Page: <a href=\"www.facebook.com/sirajganjsohor\" style=\"color: #2E86C1; text-decoration: none;\">www.facebook.com/sirajganjsohor</a><br>  \r\nFacebook Group: <a href=\"www.facebook.com/groups/sirajganjsohor\" style=\"color: #2E86C1; text-decoration: none;\">www.facebook.com/groups/sirajganjsohor</a>  \r\n</p>', 0, 'd', 'd', 'd', '2024-11-03 18:00:00', '2025-02-28 05:31:15');
